import React from 'react';

const ImagesContext = React.createContext({
    firstUrl: 'https://cdn.discordapp.com/attachments/640971910460604436/658771667128025109/unknown.png',
    secondUrl: 'https://cdn.discordapp.com/attachments/640971910460604436/658770195661455360/unknown.png',
    thirdUrl: 'https://cdn.discordapp.com/attachments/640971910460604436/658770323159777312/unknown.png'
});

export default ImagesContext;
